export default function Rating(props){
    return(
        <>
            {
        props.map((item)=>{return(<>
            <div className="stars-outer">
                  <div
                    className="stars-inner"
                    style={{ width: item.rateInPercentage }}
                  ></div>
            </div>
            <span className="number-rating">({item.brand})</span>
        </>)})
    }
        </>
    );
}
